import React, { useState } from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import "../../styles/index.css";

import { useNavigate } from "react-router-dom";

const CustomNavbar = () => {
  const navigate = useNavigate();

  const [selected, setSelected] = useState(1);

  const selectedClass = "btn btn-primary";
  const notSelected = "btn btn-secondary";

  const onButtonPress = (path) => {
    navigate(path);
  };
  return (
    <div>
      <Navbar collapseOnSelect expand="md" bg="dark" variant="dark">
        <Navbar.Brand style={{ cursor: "pointer" }}>
          Lightweight Blockchain
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto ">
            <button
              className={selected === 1 ? selectedClass : notSelected}
              value="Payload List"
              onClick={() => onButtonPress("/payloadlist")}
            >
              Payload List
            </button>

            <button
              className={selected === 2 ? selectedClass : notSelected}
              value="Writer List"
              onClick={() => onButtonPress("/writerlist")}
            >
              Writer List
            </button>

            <button
              className={selected === 3 ? selectedClass : notSelected}
              value="Block List"
              onClick={() => onButtonPress("/blocklist")}
            >
              Block List
            </button>

            <button
              className={selected === 1 ? selectedClass : notSelected}
              value="Node System"
              onClick={() => onButtonPress("/nodesystem")}
            >
              Payload List
            </button>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default CustomNavbar;
